import React, { useState, useEffect } from 'react';
import { useSelector } from "react-redux";
import { EXECUTE_QUERY, FETCH_DATA_COLLECTION } from "../../apis/Apis";

const DeveloperData = () => {
  const adminEmail = useSelector((e) => e?.userAuth?.userAllData?.email);

  const [collections, setCollections] = useState([]);
  const [selectedCollection, setSelectedCollection] = useState('');
  const [filter, setFilter] = useState('{}');
  const [project, setProject] = useState('{}');
  const [sort, setSort] = useState('{}');
  const [queryResults, setQueryResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchDataCollections();
  }, []);

  const fetchDataCollections = async () => {
    try {
      const res = await FETCH_DATA_COLLECTION();
      if (res?.status_code === 200) {
        setCollections(res.collections || []);
      }
    } catch (error) {
      console.log(error);
      setError('Failed to fetch collections');
    }
  };

  const executeQuery = async () => {
    if (!selectedCollection) {
      alert('Please select a collection');
      return;
    }

    setLoading(true);
    setError('');

    try {
      // Parse JSON inputs
      let parsedFilter = {};
      let parsedProject = {};
      let parsedSort = {};

      try {
        parsedFilter = filter ? JSON.parse(filter) : {};
      } catch (err) {
        throw new Error('Invalid JSON in filter field');
      }

      try {
        parsedProject = project ? JSON.parse(project) : {};
      } catch (err) {
        throw new Error('Invalid JSON in project field');
      }

      try {
        parsedSort = sort ? JSON.parse(sort) : {};
      } catch (err) {
        throw new Error('Invalid JSON in sort field');
      }

      const res = await EXECUTE_QUERY({
        collection: selectedCollection,
        filter: parsedFilter,
        sort: parsedSort,
        project: parsedProject,
        format: "json",
      });

      if (res?.status_code === 200) {
        setQueryResults(res.data || []);
      } else {
        setError('Query execution failed');
      }
    } catch (error) {
      console.log(error);
      setError(error.message || 'Failed to execute query');
    } finally {
      setLoading(false);
    }
  };

  const clearForm = () => {
    setSelectedCollection('');
    setFilter('{}');
    setProject('{}');
    setSort('{}');
    setQueryResults([]);
    setError('');
  };

  const renderTable = () => {
    if (!queryResults.length) return null;

    const headers = Object.keys(queryResults[0]);

    return (
      <div className="table-responsive">
        <table className="table table-striped table-bordered">
          <thead className="thead-light">
            <tr>
              {headers.map((header, index) => (
                <th key={index}>{header}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {queryResults.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {headers.map((header, cellIndex) => (
                  <td key={cellIndex}>
                    {typeof row[header] === 'object' 
                      ? JSON.stringify(row[header]) 
                      : String(row[header] || '')}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div style={{ backgroundColor: '#f8f9fa', minHeight: '100vh', padding: '20px 0' }}>
      <div className="container mt-5">
        <h1 className="mb-4 text-center">Check My App Data</h1>

        {/* Display Admin Email */}
        <div className="alert alert-info mb-4">
          <strong>Admin Email:</strong> {adminEmail || 'Not logged in'}
        </div>

        <div className="card shadow-sm">
          <div className="card-body">
            {/* Collection Selection */}
            <div className="form-group mb-3">
              <label htmlFor="collectionSelect" className="form-label">Select a Collection:</label>
              <select 
                id="collectionSelect" 
                className="form-control"
                value={selectedCollection}
                onChange={(e) => setSelectedCollection(e.target.value)}
              >
                <option value="">Select</option>
                {collections.map((collection, index) => (
                  <option key={index} value={collection}>
                    {collection}
                  </option>
                ))}
              </select>
            </div>

            {/* Filter Input */}
            <div className="form-group mb-3">
              <label htmlFor="filterInput" className="form-label">Filter (JSON):</label>
              <textarea 
                id="filterInput" 
                className="form-control" 
                rows="3"
                placeholder='{"field": "value"}'
                value={filter}
                onChange={(e) => setFilter(e.target.value)}
              />
              <small className="form-text text-muted">
                Example: {"{"}"page_url": "Customer Login"{"}"} or leave empty for no filter
              </small>
            </div>

            {/* Project Input */}
            <div className="form-group mb-3">
              <label htmlFor="projectInput" className="form-label">Project (JSON):</label>
              <textarea 
                id="projectInput" 
                className="form-control" 
                rows="3"
                placeholder='{"field1": 1, "field2": 1}'
                value={project}
                onChange={(e) => setProject(e.target.value)}
              />
              <small className="form-text text-muted">
                Example: {"{"}"mobile_number": 1, "login_time": 1{"}"} or leave empty to get all fields
              </small>
            </div>

            {/* Sort Input */}
            <div className="form-group mb-3">
              <label htmlFor="sortInput" className="form-label">Sort (JSON):</label>
              <textarea 
                id="sortInput" 
                className="form-control" 
                rows="3"
                placeholder='{"field": -1}'
                value={sort}
                onChange={(e) => setSort(e.target.value)}
              />
              <small className="form-text text-muted">
                Example: {"{"}"createdAt": -1{"}"} for descending or leave empty for no sorting
              </small>
            </div>

            {/* Error Display */}
            {error && (
              <div className="alert alert-danger">
                <strong>Error:</strong> {error}
              </div>
            )}

            {/* Submit Buttons */}
            <div className="form-group text-center">
              <button 
                type="button" 
                className="btn btn-primary mr-3"
                onClick={executeQuery}
                disabled={loading}
                style={{ marginRight: '10px' }}
              >
                {loading ? (
                  <>
                    <span 
                      className="spinner-border spinner-border-sm" 
                      role="status" 
                      aria-hidden="true"
                      style={{ marginRight: '8px', width: '1rem', height: '1rem' }}
                    ></span>
                    Running Query...
                  </>
                ) : (
                  'Run Query'
                )}
              </button>
              <button 
                type="button" 
                className="btn btn-secondary"
                onClick={clearForm}
              >
                Clear Form
              </button>
            </div>
          </div>
        </div>

        {/* Results Section */}
        {queryResults.length > 0 && (
          <div className="card shadow-sm mt-4">
            <div 
              className="card-header"
              style={{ 
                backgroundColor: '#007bff', 
                color: 'white',
                borderRadius: '0.375rem 0.375rem 0 0'
              }}
            >
              <h5 className="mb-0">Query Results ({queryResults.length} records)</h5>
            </div>
            <div className="card-body">
              {renderTable()}
            </div>
          </div>
        )}

        {/* No Results Message */}
        {!loading && queryResults.length === 0 && selectedCollection && !error && (
          <div className="alert alert-warning mt-4">
            No results found for the current query.
          </div>
        )}
      </div>

      {/* Add Bootstrap CSS */}
      <link 
        href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css" 
        rel="stylesheet"
      />

      <style jsx>{`
        .card {
          border-radius: 0.5rem;
          border: 1px solid #dee2e6;
        }
        .form-control {
          border-radius: 0.375rem;
        }
        .btn {
          border-radius: 0.375rem;
        }
        .alert {
          border-radius: 0.375rem;
        }
        .table th {
          background-color: #f8f9fa;
          font-weight: 600;
        }
        .table-responsive {
          border-radius: 0.375rem;
        }
        .spinner-border {
          display: inline-block;
          width: 2rem;
          height: 2rem;
